package leetecode.string;

import java.util.*;

public class SortCharsByFrequency {
    // 05/17 -> 0/10
    //https://leetcode.com/problems/sort-characters-by-frequency/submissions/
    public String frequencySort(String s) {
        char c[] = s.toCharArray();
        Map<Character, Integer> map = new HashMap();
        for(char ch: c){
            map.put(ch, map.getOrDefault(ch, 0)+1);
        }
        PriorityQueue<Map.Entry<Character, Integer>> pq = new PriorityQueue<>((e1, e2) -> e2.getValue()-e1.getValue());
        pq.addAll(map.entrySet());
        StringBuilder sb = new StringBuilder();
        while (!pq.isEmpty()) {
            Map.Entry<Character, Integer> entry = pq.poll();
            for(int i=0; i<entry.getValue(); i++){
                sb.append(entry.getKey());
            }
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        SortCharsByFrequency scb = new SortCharsByFrequency();
        System.out.println(scb.frequencySort("aabaccdcjghjgkhggetsxkjahgfjjc"));
        //System.out.println(scb.frequencySort(""));
    }
}
